    "body": "<p>You can use </p>\n\n<pre><code>document.location.hash = 'path'\n</code></pre>\n\n<p>Notes:</p>\n\n<ul>\n<li>This is a static string path. </li>\n<li>The history is appended properly with this.</li>\n</ul>\n"
